import styled from "styled-components";

export const NavBlock = styled.div`
  width: 80%;
  height: 100%;
  margin: 0 auto;
  background-color:chartreuse;
  display: flex;
  justify-content: space-around;
  align-items: center;
`;

export const NavItem = styled.div`
  background-color: #00B7FF;
  line-height: 100%;
`
